import React, { FC, useEffect, useState } from 'react';
import { Button, Form, Input } from 'antd';
import Link from 'next/link';

export const LoginForm: FC = () => {
  const [form] = Form.useForm();

  return (
    <Form
      form={form}
      onFinish={() => {
        console.log(form.getFieldValue('user-id'));
      }}>
      <Form.Item
        label={'User-ID'}
        name='user-id'
        required>
        <Input />
      </Form.Item>
      <Form.Item
        label={'Password'}
        name='password'
        required>
        <Input type='password' />
      </Form.Item>
      <Form.Item>
        <Button
          type='primary'
          htmlType='submit'>
          Login
        </Button>
        <Link href='/signup'>
          <a>
            <Button>Sign up</Button>
          </a>
        </Link>
      </Form.Item>
    </Form>
  );
};
